import './App.css';
import Films from "./components/Movie/Films";
import NavBar from "./components/NavBar/NavBar";
import FilmsPage from "./components/Movie/FilmsPage";
import {Switch, Route} from "react-router-dom";
function App() {
    return (
        <div className='App'>
            <NavBar/>
            <Films/>
            <Switch>
                <Route path="/movies">
                    <FilmsPage/>
                </Route>
            </Switch>



        </div>
    );
}

export default App;
